                "body": "# Synchroniser vos notes\n\nJoplin vous permet de synchroniser vos donnÃ©es Ã  l'aide de divers services d'hÃ©bergement de fichiers. Les services cloud pris en charge sont les suivantsÂ :\n\n## Configuration de la synchronisation Joplin Cloud\n\n[Joplin Cloud](https://joplinapp.org/plans/) est un service Web spÃ©cialement conÃ§u pour Joplin. Outre la synchronisation de vos donnÃ©es, il vous permet Ã©galement de publier une note sur Internet ou de partager un carnet avec vos amis, votre famille ou vos collÃ¨gues. Joplin Cloud, par rapport Ã  d'autres services, prÃ©sente Ã©galement un certain nombre d'amÃ©liorations des performances permettant une synchronisation plus rapide.\n\nPour l'utiliser, rendez-vous dans l'Ã©cran de configuration, puis dans la rubrique Synchronisation. Dans la liste des cibles de synchronisation, sÃ©lectionnez \"Joplin Cloud\". Entrez votre e-mail et votre mot de passe, et vous Ãªtes prÃªt Ã  utiliser Joplin Cloud.\n\n## Configuration de la synchronisation Dropbox\n\nSÃ©lectionnez \"Dropbox\" comme cible de synchronisation dans l'Ã©cran de configuration. Ensuite, pour lancer le processus de synchronisation, cliquez sur le bouton \"Synchroniser\" dans la barre latÃ©rale et suivez les instructions.\n\n##Â Configuration de la synchronisation Nextcloud\n\nNextcloud est une solution de cloud pouvant Ãªtre auto-hÃ©bergÃ©e. Pour le configurer, accÃ©dez Ã  l'Ã©cran de configuration et sÃ©lectionnez Nextcloud comme cible de synchronisation. Saisissez ensuite l'URL WebDAV (pour l'obtenir, rendez-vous sur votre page Nextcloud, cliquez sur ParamÃ¨tres dans le coin infÃ©rieur gauche de la page et copiez l'URL). Notez qu'il doit s'agir de l'**URL complÃ¨te**, donc par exemple si vous voulez que les notes soient sous `/Joplin`, l'URL serait quelque chose comme `https://example.com/remote.php/webdav /Joplin` (notez que la partie \"/Joplin\"). Et **assurez-vous de crÃ©er le rÃ©pertoire \"/Joplin\" dans Nextcloud**. DÃ©finissez enfin le nom d'utilisateur et le mot de passe. Si cela ne fonctionne pas, veuillez [voir cette explication](https://github.com/laurent22/joplin/issues/61#issuecomment-373282608) pour plus de dÃ©tails.\n\n## Configuration de la synchronisation OneDrive ou WebDAV\n\nOneDrive et WebDAV sont Ã©galement pris en charge en tant que services de synchronisation. Veuillez consulter [la documentation de synchronisation](https://github.com/laurent22/joplin#synchronisation) pour plus d'informations.\n\n## Utilisation du chiffrement de bout en bout\n\nJoplin prend en charge le chiffrement de bout en bout (E2EE) sur toutes les applications. E2EE est un systÃ¨me oÃ¹ seul le propriÃ©taire des donnÃ©es peut les lire. Il empÃªche les espions potentiels, y compris les fournisseurs de tÃ©lÃ©communications, les fournisseurs d'accÃ¨s Internet et mÃªme les dÃ©veloppeurs de Joplin, d'accÃ©der aux donnÃ©es. Veuillez consulter le [tutoriel sur le chiffrement de bout en bout](https://joplinapp.org/e2ee/) pour plus d'informations sur cette fonctionnalitÃ© et comment l'activer.",
